import { StyleSheet, Text, View } from 'react-native';
import { NativeRouter, Route } from 'react-router-native'

import {
  Home 
} from './pages'

export default function App() {
  return (
    <NativeRouter>
      <Route path="/" component={<Home />} />
    </NativeRouter>
  )
}
